window.onload = function () {
  const perks = [
    {
      title: "Joining Bounes",
      description: "On joining our company you get the joining bounes upto 1 lakh",
      image: "data:image/jpeg;base64,"
    },
    {
      title: "Work from home",
      description: " work from home option is also available.",
      image: "data:image/jpeg;base64,"
    },
    {
      title: "Gym membership",
      description: "you can now access gyms with company discounts.",
      image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRgYuG4qUFYA68auMl9RtWLeaI1TuuaPB9YxA&s"
    },
    {
      title: "Flexible timing",
      description: "Company time is flexible usually from 10 - 7:30",
      image: "data:image/jpeg;base64,"
    },
    {
      title: "Running club",
      description: "Run for oue club and get some excited gifts",
      image:"data:image/jpeg;base64,"
    }
  ];

  const container = document.getElementById("perks-container");

  perks.forEach(perk => {
    const card = document.createElement("div");
    card.className = "perk-card";

    card.innerHTML = `
      <img class="perk-img" src="${perk.image}" alt="${perk.title}" />
      <div class="perk-title">${perk.title}</div>
      <div class="perk-desc">${perk.description}</div>
    `;

    container.appendChild(card);
  });
};